// Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import BentoBoxes from '../components/BentoBoxes';

const Home = () => {
    return (
        <div className="dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text h-screen w-full overflow-hidden">
            <div className="text-4xl font-bold pt-12 pl-12">Home</div>
            <div className='p-12'>
                {/* Use the BentoBoxes component */}
                <BentoBoxes />
            </div>
        </div>
    );
};

export default Home;
